import React from "react";
import "./MainPageComponent.css";

class Profile extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      searchWord: "",
      firstName: "Axl",
      lastName: "Rose",
      pings: [],
      followers: [],
      following: [1, 2, 3, 4, 5, 6, 7, 8, 9],
      trends: [],
    };
  }

  componentDidMount() {}

  render() {
    return <div></div>;
  }
}

export default Profile;
